/*CREATE THE GENRE TABLE
ID FOR PRIMARY KEY
THEN THE NAME OF THE GENRE AND A DESCRIPTION OF IT*/
CREATE TABLE GENRE
(
	genre_id VARCHAR2(10) NOT NULL,
	genre_name VARCHAR2(20) NOT NULL,
	genre_description VARCHAR2(250) NOT NULL,
	CONSTRAINT genre_pk PRIMARY KEY (genre_id)
);

/*CREATETHE CUSTOMER TABLE
PRAMY KEY ID AND A FOREIGN KEY FOR THEIR PREFERED GENRE
THEN CREDIT CARD, EMAIL, AND SOME OTHER RELEVENT DATA 
NOT WORRIED ABOUT PHONE NUMBERS, EMAIL WILL DO FOR COMMUNICATION*/
CREATE TABLE CUSTOMER
(
	cust_id VARCHAR2(10) NOT NULL,
	cust_first_name VARCHAR2(20) NOT NULL,
	cust_last_name VARCHAR2(20) NOT NULL,
	cust_street_num NUMBER(20),
	cust_street_name VARCHAR2(100),
	cust_city VARCHAR2(20),
	cust_state VARCHAR2(20),
	cust_zip NUMBER(5),
	cust_credit_card VARCHAR2(24), 
	cust_pref_genre VARCHAR2(10),
	cust_email VARCHAR2(30) NOT NULL,
	CONSTRAINT cust_pk PRIMARY KEY (cust_id),
	CONSTRAINT pref_genre_pk FOREIGN KEY (cust_pref_genre) REFERENCES GENRE (genre_id)
);

/*CREATE DEVELOPER TABLE 
PRIMARY ID, THEN SOME BASIC BUSININESS INFO
GAME FEE, TO BE PAID TO SERVICE;
GAME DISCOUNT, TO APPLY TO GAME*/
CREATE TABLE DEVELOPER
(
	developer_id VARCHAR2(10) NOT NULL,
	developer_name VARCHAR2(30) NOT NULL,
	developer_street_num NUMBER(10) NOT NULL,
	developer_street_name VARCHAR2(30) NOT NULL,
	developer_discount NUMBER(5) NOT NULL,
	developer_fee_deduction NUMBER(5) NOT NULL,
	developer_bank VARCHAR2(40) NOT NULL,
	developer_bank_routing NUMBER(9) NOT NULL,
	CONSTRAINT developer_pk PRIMARY KEY (developer_id)
);

/*CREATE GAME TABLE
PRIMARY ID, THEN A REFERENCE TO THE MAIN GENRE AND DEVELOPER
THE GAMES TITLE AND BASE COST*/
CREATE TABLE GAME
(
	game_id VARCHAR2(10) NOT NULL,
	game_title VARCHAR2(50) NOT NULL,
	game_developer_id VARCHAR2(10) NOT NULL,
	game_main_genre VARCHAR2(10) NOT NULL,
	game_base_cost number(4) NOT NULL,
	CONSTRAINT game_pk PRIMARY KEY (game_id),
	CONSTRAINT game_genre_fk FOREIGN KEY (game_main_genre) REFERENCES GENRE (genre_id),
	CONSTRAINT game_developer_fk FOREIGN KEY (game_developer_id) REFERENCES DEVELOPER (developer_id)
);


/*CREATE THE REDEEMABLECODE TABLE
THE CODE ITSELF IS UNIQUE AND WILL SERVE AS THE KEY
OTHER THEN THAT THERE IS JUST A REFERENCE TO THE CODE IT REPRESENTS
DATA INSERTED IS DATA ACTIVED, AFTER 30 DAYS THE CODE IS NO LONGER 
AVALABLE FOR SALE, BUT WILL REMAIN SINCE A PURCHASED CODE COULD STILL BE REDEAMED, 
THEREFORE THE CODE CAN NOT BE REUSED*/
CREATE TABLE REDEEMABLE_CODE
(
	red_code_id VARCHAR2(19) NOT NULL,
	red_code_game_id VARCHAR2(10) NOT NULL,
	red_code_active_date DATE NOT NULL,
	CONSTRAINT red_code_pk PRIMARY KEY (red_code_id),
	CONSTRAINT red_code_game_fk FOREIGN KEY (red_code_game_id) REFERENCES GAME (game_id)
);


/*CREATE TRANSACTION TABLE
A PRIMAY ID AND A REFERENCE TO THE CUSTOMER 
WHO BAUGHT THE KEY AND THE GAME THE KEY UNLOCKS
HAS A DATE FIELD BUT IT IS NOT MANDATORY*/
CREATE TABLE TRANSACTION
(
	trans_id VARCHAR2(12) NOT NULL,
	trans_cust_id VARCHAR2(10) NOT NULL,
	trans_code_id VARCHAR2(19) NOT NULL,
	trans_date DATE,
	CONSTRAINT trans_pk PRIMARY KEY (trans_id, trans_cust_id, trans_code_id),
	CONSTRAINT trans_cust_fk FOREIGN KEY (trans_code_id) REFERENCES REDEEMABLE_CODE (red_code_id),
	CONSTRAINT trans_code_fk FOREIGN KEY (trans_cust_id) REFERENCES CUSTOMER (cust_id)
);

/*CREATE THE GENRE GAME PAIRS TO SHOW
WHAT GAMES BELONG TO WHAT SECONDARY GENRES*/
CREATE TABLE GENRE_GAME_PAIR
(
	ggp_genre_id VARCHAR2(10) NOT NULL,
	ggp_game_id VARCHAR2(10) NOT NULL,
	CONSTRAINT ggp_pk PRIMARY KEY (ggp_genre_id, ggp_game_id),
	CONSTRAINT ggp_genre_pk FOREIGN KEY (ggp_genre_id) REFERENCES GENRE (genre_id),
	CONSTRAINT ggp_game_pk FOREIGN KEY (ggp_game_id) REFERENCES GAME (game_id)
);


